import React from 'react'
import cate from './cate.css';
function Category(props) {
  return (
     <div>
       <div className='cate'>
                <p className='travel'>{props.data}</p>
                <p className='date'> / Auguest 21/2017</p>
            </div>
     </div>
  )
}

export default Category;
